import { Route,Routes,Link } from 'react-router-dom';
import './App.css';
import Home from './components/home';

function App() {
  return (
    <div className="App">
     <nav>
      <Link to="/home">hi</Link>
     </nav>
     <Routes>
      <Route path='/home' element={<Home/>}/>
     </Routes>
    </div>
  );
}

export default App;
